import React from "react";

import './style.css';

import { Col, Container, Row } from 'react-bootstrap';

function Tester() {

  function WriteSometh(props:string){
    return <h1>Привет, {props.name}</h1>
  }

  return (
    <>
    <Container fluid>
      <Row>
        <WriteSometh name = 'Алиса'></WriteSometh>
      </Row>
    </Container>
    </>
  );
}

export default Tester;
